import React from "react";
import Simpson from "./Simpson";

function Simpsons({ data, favourited }) {
  return data.map((data, id) => {
    return (
      <Simpson key={id} id={data.id} data={data} favourited={favourited} />
    );
  });
}

export default Simpsons;
